import React from 'react';

// PrivateRoute will be a stateless functional component that only takes props
function PrivateRoute(props){
// props has an object called children
  var toggle = true;

  return(
    <Route render={() => {
      if(toggle){
        <h1>Hello!</h1>
      } else {
        <h1>Goodbye!</h1>
      }
    }}/>
  );
};

export default PrivateRoute;
